import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Line } from "react-chartjs-2";
import { UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
import {
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  CardTitle,
  Form,
  Input,
  Button,
  Row,
  Col,
} from "reactstrap";

export default class NewPatient extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
          my_rows: [1],

      }

      this.handleSubmit = this.handleSubmit.bind(this);

    }

    handleSubmit(e){
        e.preventDefault();
        console.log("cliquei");
    }



    render() {

        return (
            <>
                <div className="content">
                    <Row>
                    <Col>
                        <Form onSubmit={this.handleSubmit}>
                            <Col md="4"  form>
                                {/* UserName */}

                                    <label htmlFor="feFirstName">Nome</label>
                                    <Input
                                        id="feFirstName"
                                        placeholder=""
                                        name="name"
                                        /*onChange={(e)=>setUsername(e.target.value)} */
                                    />

                                {/* PassWord */}

                                    <label htmlFor="feLastName" style={{marginTop:"30px"}}>Idade</label>
                                    <Input
                                        id="feLastName"
                                        placeholder=""
                                        type="number"
                                        name="age"
                                        /*onChange={ (e)=>setPassword(e.target.value) }*/
                                    />

                                <label>Treatment - Pills </label> <br></br>
                                {this.state.my_rows.map( (row) => {

                                    return (
                                        <span>
                                            <label>Name</label>
                                            <Input
                                            id="feLastName"
                                            placeholder=""
                                            type="text"
                                            name="age"
                                            /*onChange={ (e)=>setPassword(e.target.value) }*/
                                            />
                                        </span>

                                    )

                                } )}

                                <Button theme="accent"  style={{marginLeft: "70px", marginTop:"30px"}}>Create</Button>

                            </Col>

                        </Form>
                    </Col>
                    </Row>
                </div>
            </> 
            )
    }
}
